@HipsterBrown

there definitely has to be a pattern for GitHub and Twitter: ie for GitHub /^[a-z\d](?:[a-z\d]|-(?=[a-z\d])){0,38}$/i; https://github.com/shinnn/github-username-regex
for website URL, some users will be tempted to first enter the website without http or https, ie: airbnb.com . I was asking if we should accept that? I don't know what is the best practice. We should check some examples in the wild. For sure, it's ok to be strict in a first version, no problem with that.

