Especially using the media queries (though it is an example in the docs) could be a bit confusing I guess, but yeah, as I'm new to stylelint it was just hard to think of good examples.

Yeah you're right, I think the media queries might make it too complicated. You could just do this:
Wrong
/* stylelint-disable color-named */
import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  background-color: red;
`;
Right
import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  /* stylelint-disable color-named */
  background-color: red;
`;
Also stylelint supports different types of configuration comments from within the css. So it's probably best to change the  'stylelint-disable' heading to 'Turning rules off from within your CSS', as that's what it's called in the stylelint docs. Also it'd be good to add a link to this section of the stylelint docs: https://stylelint.io/user-guide/configuration/#turning-rules-off-from-within-your-css

It'd be neat to have in here though so no one else submits erroneous issues like I did :).

No worries, issues with the docs are also valid issues! And prs like this are definitely appreciated ğŸ‘

